 * @LastEditors: lujiafeng
 * @Description: 
 * @FilePath: \debug-anything\react-test\src\App.jsx
 * 可以输入预定的版权声明、个性签名、空行等
 */
/**
 * @Author: lujiafeng
 * @Date: 2022-06-15 19:59:06
 * @LastEditTime: 2022-06-16 23:27:59
 * @LastEditors: lujiafeng
 * @Description: 
 * @FilePath: \debug-anything\react-test\src\App.js
 * @可以输入预定的版权声明、个性签名、空行等
 */
import logo from './logo.svg';
import './App.css';
import { useEffect, useState, Suspense } from "react"

function LazyCompDemo () {
  return (
    <>
      <p>
        lazy demo
      </p>
    </>
  )
}
function Loading () {
  return (
    <div>
      ...
    </div>
  )
}
function App () {

  const [state, setState] = useState("231")
  function changeState () {
    setState(state + 1)
  }
  useEffect(() => {
    console.log(111)
  }, [])

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React {state}
        </a>
        <button onClick={() => { console.log(1111) }}>start</button>
      </header>
      <Suspense fallback=""></Suspense>
    </div>
  );
}
export default App;
